import React, { useState } from 'react';
import './JobBoard.css';

// 模拟的工作数据
const initialJobs = [
  { id: 1, job: 'Software Engineer', company: 'Google', updateDate: '2023-05-15', location: 'Mountain View, CA', yoe: '3-5' },
  { id: 2, job: 'Data Scientist', company: 'Facebook', updateDate: '2023-05-14', location: 'Menlo Park, CA', yoe: '2-4' },
  { id: 3, job: 'Product Manager', company: 'Amazon', updateDate: '2023-05-13', location: 'Seattle, WA', yoe: '5-7' },
  { id: 4, job: 'UX Designer', company: 'Apple', updateDate: '2023-05-12', location: 'Cupertino, CA', yoe: '3-6' },
  { id: 5, job: 'Frontend Developer', company: 'Microsoft', updateDate: '2023-05-11', location: 'Redmond, WA', yoe: '2-5' },
];

function JobBoard() {
  const [jobs, setJobs] = useState(initialJobs);
  const [searchTerm, setSearchTerm] = useState('');
  const [showFilters, setShowFilters] = useState(false);
  const [filters, setFilters] = useState({
    location: '',
    yoe: '',
  });

  const handleSearch = () => {
    const filteredJobs = initialJobs.filter(job => 
      job.company.toLowerCase().includes(searchTerm.toLowerCase())
    );
    setJobs(filteredJobs);
  };

  const handleFilter = () => {
    const filteredJobs = initialJobs.filter(job => {
      return (
        job.company.toLowerCase().includes(searchTerm.toLowerCase()) &&
        (filters.location === '' || job.location.includes(filters.location)) &&
        (filters.yoe === '' || job.yoe.includes(filters.yoe))
      );
    });
    setJobs(filteredJobs);
  };

  return (
    <div className="job-board">
      <h1>Job Board</h1>
      <div className="search-filter">
        <input
          type="text"
          placeholder="Search by company"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
        />
        <button onClick={handleSearch}>Search</button>
        <button onClick={() => setShowFilters(!showFilters)}>
          {showFilters ? 'Hide Filters' : 'Show Filters'}
        </button>
      </div>

      {showFilters && (
        <div className="filters">
          <input
            type="text"
            placeholder="Filter by location"
            value={filters.location}
            onChange={(e) => setFilters({...filters, location: e.target.value})}
          />
          <input
            type="text"
            placeholder="Filter by years of experience"
            value={filters.yoe}
            onChange={(e) => setFilters({...filters, yoe: e.target.value})}
          />
          <button onClick={handleFilter}>Apply Filters</button>
        </div>
      )}

      <table>
        <thead>
          <tr>
            <th>Job</th>
            <th>Company</th>
            <th>Update Date</th>
            <th>Location</th>
            <th>Years of Experience</th>
          </tr>
        </thead>
        <tbody>
          {jobs.map(job => (
            <tr key={job.id}>
              <td>{job.job}</td>
              <td>{job.company}</td>
              <td>{job.updateDate}</td>
              <td>{job.location}</td>
              <td>{job.yoe}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default JobBoard;
